INSERT INTO `rainlab_translate_messages` (`id`, `code`, `message_data`) VALUES
(1, 'dfm.groupe', '{"x":"DFM Groupe","en":"DFM Group"}'),
(2, 'développement.logiciel', '{"x":"D\\u00e9veloppement logiciel","en":"Software development"}'),
(3, 'dfm.est.un.groupe.proposant.des.activités.et.des.services.en.développement.logiciel.ingénierie.scientifique.et.informatique.au.cœur.des.enjeux.de.nos.clients.dans.une.relation.de.proximité.nos.experts.assisté.de.notre.centre.de.développement.en.asie....', '{"x":"DFM est un groupe proposant des activit\\u00e9s et des services en d\\u00e9veloppement logiciel, ing\\u00e9nierie scientifique et informatique. Au c\\u0153ur des enjeux de nos clients, dans une relation de proximit\\u00e9, nos experts assist\\u00e9 de notre centre de d\\u00e9veloppement en Asie accompagne les PME et grands comptes dans de nombreux secteurs et dans une large gamme de services :","en":"DFM is a group providing services in software development, scientific and computer engineering. At the heart of the stakes of our customers, in a close relationship, our experts assisted by our development center in Asia are close to SMEs and large accounts in many sectors and in a wide range of services: "}'),
(4, 'web.applications.logiciels.systèmes.connectésembarqués', '{"x":"Web-applications, logiciels & syst\\u00e8mes connect\\u00e9s\\/embarqu\\u00e9s","en":"Web-app, software & connected\\/embedded systems"}'),
(5, 'dfm.propose.une.solution.globale.permettant.dassurer.le.développement.de.votre.outil.informatique.dédié.connecté.à.votre.environnement.propre.serveur.smartphone.etc.des.systèmes.connectésembarqués.peuvent.également.la.compléter', '{"x":"DFM propose une solution globale permettant d\\u2019assurer le d\\u00e9veloppement de votre outil informatique d\\u00e9di\\u00e9, connect\\u00e9 \\u00e0 votre environnement propre (serveur, smartphone etc). Des syst\\u00e8mes connect\\u00e9s\\/embarqu\\u00e9s peuvent \\u00e9galement la compl\\u00e9ter.","en":"DFM offers a global solution to ensure the development of your dedicated IT tool, connected to your own environment (server, smartphone etc). Connected \\/ embedded systems can also complement it."}'),
(6, 'réalité.virtuelle', '{"x":"R\\u00e9alit\\u00e9 Virtuelle","en":"Virtual Reality"}'),
(7, 'la.vr.comme.outil.au.quotidien', '{"x":"La VR comme outil au quotidien","en":"New RV tool"}'),
(8, 'dfm.dispose.des.compétences.rd.dingénierie.qui.lui.permette.de.vous.proposer.des.expériences.vr.à.partir.doutils.existants.ou.développés.sur.mesure', '{"x":"DFM dispose des comp\\u00e9tences R&D, d''ing\\u00e9nierie qui lui  permette de vous proposer des exp\\u00e9riences VR \\u00e0 partir d\\u2019outils existants ou d\\u00e9velopp\\u00e9s sur mesure.","en":"Our R & D and engineering capabilities enable us to offer you VR experiments using existing or customized tools."}'),
(9, 'ingénierie.technique.scientifique', '{"x":"Ing\\u00e9nierie technique & scientifique","en":"Scientific & Technical Engineering"}'),
(10, 'calculs.scientifiques.dédiés', '{"x":"Calculs scientifiques d\\u00e9di\\u00e9s","en":"Dedicated scientific approach"}'),
(11, 'de.la.mécanique.conception.validation.à.la.mécanique.des.fluides.tout.en.intégrant.les.couplages.complexes.dfm.se.positionne.comme.un.interlocuteur.privilégié.aéronautique.défense.transport.énergie.en.apportant.une.réponse.dédiée.et.experte', '{"x":"De la m\\u00e9canique (conception- validation) \\u00e0 la m\\u00e9canique des fluides tout en int\\u00e9grant les couplages complexes, DFM se positionne comme un interlocuteur privil\\u00e9gi\\u00e9 (a\\u00e9ronautique, d\\u00e9fense, transport, \\u00e9nergie, \\u2026) en apportant une r\\u00e9ponse d\\u00e9di\\u00e9e et experte.","en":"DFM is positioned as a privileged interlocutor (aeronautics, defense, transport, energy, ...) by providing a dedicated and expert response from mechanical (design-validation) to fluid mechanics while integrating complex couplings."}'),
(12, 'nos.valeurs', '{"x":"Nos valeurs","en":"Our values"}'),
(13, 'dfm.est.un.groupe.proposant.des.activités.et.des.services.en.développement.logiciel.ingénierie.scientifique.et.informatique', '{"x":"DFM est un groupe proposant des activit\\u00e9s et des services en d\\u00e9veloppement logiciel, ing\\u00e9nierie scientifique et informatique","en":"DFM is a group providing services in software development, scientific and computer engineering. At the heart of the stakes of our customers, in a close relationship, our experts assisted by our development center in Asia are close to SMEs and large accounts in many sectors and in a wide range of services: "}'),
(14, 'qualité.de.service', '{"x":"Qualit\\u00e9 de service","en":"Outstanding service"}'),
(15, '100.de.nos.clients.satisfaits', '{"x":"100% de nos clients satisfaits","en":"100% of clients satisfied"}'),
(16, 'une.présence.internationale', '{"x":"Une pr\\u00e9sence internationale","en":"International"}'),
(17, 'france.espagne.vietnam.brésil', '{"x":"France, Espagne, Vietnam, Br\\u00e9sil","en":"France, Espagne, Vietnam, Br\\u00e9sil"}'),
(18, 'sécurité.optimisée', '{"x":"S\\u00e9curit\\u00e9 Optimis\\u00e9e","en":"Optimal security"}'),
(19, 'échanges.de.données100.securisee', '{"x":"\\u00c9changes de donn\\u00e9es100% se\\u0301curise\\u0301e","en":"Secured data exchange "}'),
(20, 'adaptabilité', '{"x":"Adaptabilit\\u00e9","en":"Adaptability"}'),
(21, 'ergonomie.et.design.sont.les.cles.dun.outil.intuitif.et.a.usage.facilite', '{"x":"Ergonomie et design sont les cle\\u0301s d''un outil intuitif et a\\u0300 usage facilite\\u0301","en":"Ergonomics and design are the keys to an intuitive and easy-to-use tool"}'),
(22, 'le.logiciel.est.un.maillon.essentiel.et.son.développement.optimisé.doit.être.accompagné.de.performance.de.qualité.et.de.rentabilité.pour.cela.nos.équipes.mettent.en.applications.les.méthodes.agiles.et.en.y.intégrant.les.règles.métiers.pour.vous.aider...', '{"x":"Le logiciel est un maillon essentiel et son d\\u00e9veloppement optimis\\u00e9 doit \\u00eatre accompagn\\u00e9 de performance, de qualit\\u00e9 et de rentabilit\\u00e9. Pour cela, nos \\u00e9quipes mettent en applications les m\\u00e9thodes agiles et en y int\\u00e9grant les r\\u00e8gles m\\u00e9tiers pour vous aider \\u00e0 relever ces d\\u00e9fis et d\\u00e9velopper des logiciels \\u00e9volutifs, s\\u00e9curis\\u00e9es et facilement d\\u00e9ployable dans des temps r\\u00e9dults. Nous offrons des services logiciels qui couvrent toutes les \\u00e9tapes du cycle de vie du produit de la conceptualisation \\u00e0 la maintenance et de la documentation.","en":"Software is the today\\u2019s essential link and its optimized development must be accompanied by performance, quality and profitability. To do this, our teams develop agile methods to integrating business rules as well as scalablity, secured and easily deployable software in redundant times. We offer software services that cover all steps of the life cycle product from scratch up  to maintenance."}'),
(23, 'application.mobile', '{"x":"Application Mobile","en":"Application Mobile"}'),
(24, 'la.création.dapplications.mobiles.repose.sur.une.méthode.adaptée.à.la.mobilité.qui.place.lexpérience.utilisateur.au.centre.du.cycle.de.production.lergonomie.de.lapplication.est.primordiale.comme.lest.également.sa.comptatibilité.platforme.iphone.ipad....', '{"x":"La cr\\u00e9ation d\\u2019applications mobiles repose sur une m\\u00e9thode adapt\\u00e9e \\u00e0 la mobilit\\u00e9 qui place l\\u2019exp\\u00e9rience utilisateur au centre du cycle de production.  L\\u2019ergonomie de l\\u2019application est primordiale comme l\\u2019est \\u00e9galement sa comptatibilit\\u00e9 platforme (iPhone, iPad, tablettes, smartphones Android et smartphones Windows Phone\\u2026)","en":"Mobile application development is based on a dedicated to mobility that places the user experience at the center of the production cycle. Ergonomy of the application is paramount as is also its compatibility platform (iPhone, iPad, tablets, Android smartphones and Windows Phone smartphones ...)"}'),
(25, 'logiciel.dédié', '{"x":"Logiciel d\\u00e9di\\u00e9","en":"Dedicated Software"}'),
(26, 'dfm.prend.en.compte.toutes.les.étapes.de.la.réalisation.de.votre.logiciel.de.la.rédaction.du.cahier.des.charges.jusquà.la.hot.line.nos.équipes.logiciel.proposent.des.services.personnalisés.des.solutions.de.qualité.avec.des.tarifs.attractifs', '{"x":"DFM prend en compte toutes les \\u00e9tapes de la r\\u00e9alisation de votre logiciel, de la r\\u00e9daction du cahier des charges jusqu\\u2019\\u00e0 la hot-line. Nos \\u00e9quipes \\u00ab\\u00a0Logiciel\\u00a0\\u00bb proposent des services personnalis\\u00e9s, des solutions de qualit\\u00e9 avec des tarifs attractifs.","en":"DFM takes into account all the stages of the realization of your software, from the drafting of the specifications to the hot-line. Our \\"Software\\" teams offer personalized services, quality solutions with attractive rates"}'),
(27, 'a.titre.dexemple.dfm.développe.intègre.et.maintient.le.logiciel.vitrages.décision.ginger.cebtp.depuis.plus.de.10ans.au.delà.des.qualités.requises.en.informatique.la.maîtrise.de.la.physique.dédiée.aux.vitrages.a.permis.un.développement.des.plus.effica...', '{"x":"A titre d''exemple, DFM d\\u00e9veloppe, Int\\u00e8gre et maintient le logiciel Vitrages D\\u00e9cision, GINGER CEBTP, depuis plus de 10ans. Au-del\\u00e0 des qualit\\u00e9s requises en informatique, la ma\\u00eetrise de la physique d\\u00e9di\\u00e9e aux vitrages a permis un d\\u00e9veloppement des plus efficaces.","en":"As an example, DFM develops, integrates and maintains the VD Glazing Decisions software, GINGER CEBTP, for more than 10 years. Beyond the qualities required in computer science, the dedicated physics to glazing is also controlled and managed by our engineering team providing a hight effective development as well."}'),
(28, 'les.outils.net.visual.basic.net.c.net.java.cc.fortran.delphi.opengl.direct3d', '{"x":"Les outils: .NET (Visual Basic.Net, C#.Net,\\u2026), JAVA, C\\/C++, Fortran, Delphi, OpenGL, Direct3D\\u2026","en":"The tools: .NET (Visual Basic.Net, C # .Net, ...), JAVA, C \\/ C ++, Fortran, Delphi, OpenGL, Direct3D ..."}'),
(29, 'infogerance', '{"x":"Infogerance","en":"IT outsourcing business"}'),
(30, 'la.disponibilité.de.vos.systèmes.informatiques.est.indispensable.à.votre.activité.et.linfogérance.site.internet.hors.fonctionnement.un.service.de.courriels.non.disponible.une.faille.de.sécurité.exploitée.par.un.utilisateur.malveillant.une.complexité....', '{"x":"La disponibilit\\u00e9 de vos syst\\u00e8mes informatiques est indispensable \\u00e0 votre activit\\u00e9 et l\\u2019infog\\u00e9rance (site internet hors fonctionnement, un service de courriels non disponible, une faille de s\\u00e9curit\\u00e9 exploit\\u00e9e par un utilisateur malveillant, une complexit\\u00e9 des serveurs linux de stockages et de calculs HPC, \\u2026) est la solution qui vous s\\u00e9duit mais pas les tarifs pratiqu\\u00e9s par les soci\\u00e9t\\u00e9s d\\u2019infog\\u00e9rance? ","en":"The availability of your IT systems is essential to your business and IT outsourcing business (non-functioning website, unavailable e-mail service, attacker exploit a potential vulnerability, complexity of linux storage and HPC computers, ...) is an attractive solution but not the rates usually charged by outsourcing companies? Call us and change your mind about IT outsourcing business."}'),
(31, 'appelez.nous.et.changer.davis.sur.linfogérance', '{"x":"Appelez-nous et changer d\\u2019avis sur l\\u2019infog\\u00e9rance"}'),
(32, 'système.connecté.amp.embarqué', '{"x":"Syst\\u00e8me connect\\u00e9 &amp; embarqu\\u00e9","en":"Connected & embedded system"}'),
(33, 'architecture.des.systèmes.embarqués.systèmes.de.stockage.gestion.des.communications.et.des.réseaux.à.partir.de.la.constitution.de.circuits.intégrés.gestion.des.architectures.de.systèmes.à.grande.échelle.centres.de.données.cloud.computing.réseaux.et.s...', '{"x":"Architecture des syst\\u00e8mes embarqu\\u00e9s, syst\\u00e8mes de stockage, gestion des communications et des r\\u00e9seaux \\u00e0 partir de la constitution de circuits int\\u00e9gr\\u00e9s. Gestion des architectures de syst\\u00e8mes \\u00e0 grande \\u00e9chelle - centres de donn\\u00e9es, cloud computing, r\\u00e9seaux et syst\\u00e8mes distribu\\u00e9s, grid computing.","en":"Architecture of embedded systems, storage systems, management of communications and networks from the constitution of integrated circuits. Management of large-scale systems architectures - data centers, cloud computing, networks and distributed systems, grid computing. "}'),
(34, 'intégration.dune.large.gamme.darchitectures.cpu.x86.x86.64.arm.ppc.avr.pic.i8051.risc.avec.possibilité.de.technologies.bluetooth.wifi.rf.gsm.3g4g.dfm.intégre.lensemble.de.la.chaine.de.la.conception.du.prototype.jusquà.la.livraison.de.la.série', '{"x":"Int\\u00e9gration d\\u2019une large gamme d''architectures CPU: x86, x86_64, ARM, PPC, AVR, PIC, i8051, RISC avec possibilit\\u00e9 de technologies bluetooth, wifi, RF, GSM, 3G\\/4G. DFM int\\u00e9gre l\\u2019ensemble de la chaine, de la conception du prototype jusqu\\u2019\\u00e0 la livraison de la s\\u00e9rie.","en":"Integration of a wide range of CPU architectures: x86, x86_64, ARM, PPC, AVR, PIC, i8051, with the possibility of RISC Bluetooth, wifi, RF, GSM, 3G \\/ 4G. DFM integrates the entire chain, from prototype design to delivery of the series."}'),
(35, 'conception.et.développement.dapi.par.des.procédures.sécurisées.restful.oauth.v2.json.xml.yaml.les.technologies.intégrées.plus.avancées.sont.également.proposées.gps.gsm.sms.rf.bluetooth.ublox.microchip.gps.puces.zigbee.rf.modules.gsm', '{"x":"Conception et d\\u00e9veloppement d''API par des proc\\u00e9dures s\\u00e9curis\\u00e9es (Restful, OAUTH v2, JSON, XML, YAML\\u2026). Les technologies int\\u00e9gr\\u00e9es plus avanc\\u00e9es sont \\u00e9galement propos\\u00e9es: GPS, GSM, SMS, RF, BlueTooth, Ublox microchip GPS, Puces Zigbee RF, Modules GSM.","en":"Design and development of API by secured procedures (Restful, OAUTH v2, JSON, XML, YAML ...). More advanced integrated technologies are also proposed: GPS, GSM, SMS, RF, BlueTooth, Ublox microchip GPS, Zigbee RF chips, GSM modules. "}'),
(36, 'la.réalité.virtuelle.assure.la.reproduction.dun.environnement.réel.ou.imaginaire.et.simule.présence.et.lenvironnement.physique.dun.utilisateur.et.son.interaction.dfm.offre.des.expériences.premium.en.réalité.virtuelle.et.notre.finalité.est.de.proposer...', '{"x":"La r\\u00e9alit\\u00e9 virtuelle assure la reproduction d\\u2019un environnement r\\u00e9el ou imaginaire, et simule pr\\u00e9sence et l''environnement physique d''un utilisateur et son interaction. DFM offre des exp\\u00e9riences premium en r\\u00e9alit\\u00e9 virtuelle et notre finalit\\u00e9 est de proposer les services et les outils  des ing\\u00e9nieurs de demain.","en":"Virtual reality allows user to evolve in a real or imaginary environment and it provides interactions to the user. DFM offers premium experiences in virtual reality. Our goal is to offer services and tools of the tomorrow\\u2019s engineer and tomorrow is now today!"}'),
(37, 'visite.3d.360', '{"x":"Visite 3D 360\\u00b0","en":"360\\u00b0 3D tour tool"}'),
(38, 'capturer.un.environnement.en.3d.et.lexplorer.en.réalité.virtuelle.est.un.challenge.délicat.en.effet.le.contenu.3d.360.reconstruit.à.partir.de.quelques.caméras.disposées.en.sphère.manque.de.profondeur.et.limite.considérablement.la.liberté.de.mouvement...', '{"x":"Capturer un environnement en 3D et l''explorer en r\\u00e9alit\\u00e9 virtuelle est un challenge d\\u00e9licat. En effet, le contenu 3D 360 reconstruit \\u00e0 partir de quelques cam\\u00e9ras dispos\\u00e9es en sph\\u00e8re manque de profondeur et limite consid\\u00e9rablement la libert\\u00e9 de mouvement, pour un co\\u00fbt mat\\u00e9riel tr\\u00e8s \\u00e9lev\\u00e9. A l''inverse, scanner un lieu en 3D \\u00e0 l''aide de scanners, LIDARs ou par photogramm\\u00e9trie est complexe, difficile \\u00e0 mettre en pratique et souffre souvent d''erreurs de reconstruction 3D. Par ailleurs, il est impossible d''afficher les mod\\u00e8les 3D obtenus, tr\\u00e8s complexes, de mani\\u00e8re fluides sur un dispositif VR mobile (Cardboard ou GearVR).","en":"Capturing a 3D environment and exploring it in virtual reality is a delicate challenge. Indeed, the 360 \\u200b\\u200b3D content reconstructed from a few cameras arranged in a sphere lacks depth and greatly limits the freedom of movement for a very high material cost. Conversely, scanning a 3D location using scanners, LIDARs or photogrammetry is complex, difficult to put into practice, and often suffers from 3D reconstruction errors. Moreover, it is impossible to display the highly complex 3D models obtained in a fluid way on a mobile VR device (Cardboard or GearVR)."}'),
(39, 'nos.équipes.ont.alors.conçu.un.outil.abordable.simple.à.utiliser.capable.de.capturer.du.contenu.3d.360.statique.compatible.avec.les.plateformes.mobiles.la.génération.actuelle.noffre.pas.de.suivi.de.la.position.dans.lespace.mais.compense.par.des.écran...', '{"x":"Nos \\u00e9quipes ont alors con\\u00e7u un outil abordable, simple \\u00e0 utiliser, capable de capturer du contenu 3D 360 statique, compatible avec les plateformes mobiles. La g\\u00e9n\\u00e9ration actuelle n''offre pas de suivi de la position dans l''espace, mais compense par des \\u00e9crans haute-r\\u00e9solution : le contenu se doit donc d''\\u00eatre tr\\u00e8s haute r\\u00e9solution \\u00e9galement, st\\u00e9r\\u00e9o, mais ne n\\u00e9cessite pas de donn\\u00e9es volum\\u00e9triques","en":"Our teams then designed an affordable, easy-to-use tool capturing 3D 360-static content  compatible with all mobile platforms. The current generation does not offer position tracking in space, but compensates by high resolution screens: the content must therefore be very high resolution also, stereo, but does not require volumetric data"}'),
(40, 'visite.vr.temps.réel', '{"x":"Visite VR temps r\\u00e9el","en":"VR real time tour"}'),
(41, 'en.temps.réel.limmersion.est.évidemment.piloté.par.linteraction.et.lenjeu.est.de.gérer.qualité.graphique.et.temps.au.mieux.larchitecture.de.nos.outils.sattache.toujours.à.optimiser.ces.deux.paramètres.en.fonction.de.leffet.recherché', '{"x":"En temps r\\u00e9el, l\\u2019immersion est \\u00e9videmment pilot\\u00e9 par l\\u2019interaction et l\\u2019enjeu est de g\\u00e9rer qualit\\u00e9 graphique et temps au mieux. L\\u2019architecture de nos outils s\\u2019attache toujours \\u00e0 optimiser ces deux param\\u00e8tres en fonction de l\\u2019effet recherch\\u00e9.","en":"In real time, immersion is obviously driven by interaction and the challenge is to manage graphic quality and time at best. The architecture of our tools always strives to optimize these two parameters according to the desired effect."}'),
(42, 'le.développement.doutils.virtuels.assure.un.pilotage.ergonomique.et.précis.de.lapplication.et.nos.équipes.rd.travaillent.pour.une.qualité.optimale.de.la.visite.à.partir.dune.interaction.des.différentes.techniques.entre.elles', '{"x":"Le d\\u00e9veloppement d\\u2019outils virtuels assure un pilotage ergonomique et pr\\u00e9cis de l\\u2019application et nos \\u00e9quipes R&D travaillent pour une qualit\\u00e9 optimale de la visite \\u00e0 partir d\\u2019une interaction des diff\\u00e9rentes techniques entre elles.","en":"The development of virtual tools ensures an ergonomic and accurate management of the application and our R & D teams work for an optimal quality of the visit from an interaction of the different techniques between them."}'),
(43, 'outils.conception.vr', '{"x":"Outils conception VR","en":"Our VR customised conception"}'),
(44, 'en.tant.quingénieurs.notre.but.ultime.est.de.concevoir.de.nouvelles.perspectives.dans.les.outils.de.développement.et.de.conception.imaginez.par.exemple.une.conception.avec.une.véritable.boite.à.outil.concevez.finalisez.testez.et.partagez.vos.concepti...', '{"x":"En tant qu\\u2019ing\\u00e9nieurs, notre but ultime est de concevoir de nouvelles perspectives dans les outils de d\\u00e9veloppement et de conception. Imaginez par exemple une conception avec une v\\u00e9ritable boite \\u00e0 outil. Concevez, finalisez, testez et partagez vos conceptions d\\u2019un seul clic! De plus, l\\u2019introduction des r\\u00e8gles m\\u00e9tiers assure une r\\u00e9alisation des plans de conception directement.","en":"As engineers, our ultimate goal is to design new perspectives in development and design tools. Imagine, for example, a design with a real toolbox. Design, finalize, test and share your designs in a single click! In addition, the introduction of business rules ensures realization of design plans directly. VR-assisted design is a reality to reduce the cycle of development in relation to all your company services: marketing, development, research, manufacturing,"}'),
(46, 'réalité.augmentée', '{"x":"R\\u00e9alit\\u00e9 Augment\\u00e9e","en":"Augmented Reality "}'),
(47, 'la.réalité.augmentée.permet.dinclure.en.temps.réel.des.informations.texte.vidéo.photo.image.animées.2d.ou.3d.en.surimposition.de.la.réalité.et.de.manière.interactive', '{"x":"La r\\u00e9alit\\u00e9 augment\\u00e9e permet d\\u2019inclure en temps r\\u00e9el des informations (texte, vid\\u00e9o, photo, image anim\\u00e9es, 2D ou 3D\\u2026) en surimposition de la r\\u00e9alit\\u00e9 et de mani\\u00e8re interactive. ","en":"Augmented reality makes it possible to include in real time information (text, video, photo, animated image, 2D or 3D ...) in superimposition of reality and interactively."}'),
(48, 'les.applications.sont.infinies.et.lensemble.des.domaines.industrie.tourisme.formation.rd.va.être.impacté.nos.experts.sont.à.votre.écoute.pour.développer.la.vôtre', '{"x":"Les applications sont infinies et l\\u2019ensemble des domaines  (industrie, tourisme, formation, R&D, \\u2026) va \\u00eatre impact\\u00e9. Nos experts sont \\u00e0 votre \\u00e9coute pour d\\u00e9velopper la v\\u00f4tre...","en":"Applications are endless and all the domains (industry, tourism, training, R & D, ...) will be impacted. Our experts are at your disposal to develop yours."}'),
(49, 'loffre.en.ingénierie.scientifique.technique.de.dfm.sadresse.aux.clients.des.secteurs.industriels.aéronautique.spatial.transport.terrestre.énergie.naval.nucléaire.dfm.se.positionne.comme.votre.interlocuteur.privilégié.en.apportant.des.réponses.experte...', '{"x":"L\\u2019offre en ing\\u00e9nierie scientifique & technique de DFM s\\u2019adresse aux clients des secteurs industriels (a\\u00e9ronautique, spatial, transport terrestre, \\u00e9nergie, naval, nucl\\u00e9aire, \\u2026). DFM se positionne comme votre interlocuteur privil\\u00e9gi\\u00e9 en apportant des r\\u00e9ponses expertes. Acteur en recherche fondamentale et appliqu\\u00e9e, la qualit\\u00e9 de nos prestations n\\u2019en est que mieux renforc\\u00e9e.","en":"DFM is positioned as a privileged interlocutor (aeronautics, defense, transport, energy, ...) by providing a dedicated and expert response from mechanical (design-validation) to fluid mechanics while integrating complex couplings."}'),
(50, 'caomaillage', '{"x":"CAO\\/maillage","en":"CAD\\/meshing\\/Pre-treatment"}'),
(51, 'réduire.les.cycles.de.développement.est.un.enjeu.primordial.et.la.conception.détaillée.permet.dassure.un.développement.de.haute.qualité.tout.en.réduisant.les.coût.et.le.temps.de.fabrication.de.plus.un.management.dédié.et.une.approche.projet.limite.le...', '{"x":"R\\u00e9duire les cycles de d\\u00e9veloppement est un enjeu primordial et la conception d\\u00e9taill\\u00e9e permet d\\u2019assure un d\\u00e9veloppement de haute qualit\\u00e9 tout en r\\u00e9duisant les co\\u00fbt et le temps de fabrication. De plus, un management d\\u00e9di\\u00e9 et une approche projet limite le raisonnement it\\u00e9ratif et permet ainsi d\\u2019acc\\u00e9l\\u00e9rer les d\\u00e9veloppements.","en":"Reducing development cycles is a key issue and the detailed design ensures high quality development while reducing cost and manufacturing time. Moreover, a dedicated management and a project approach limits the iterative reasoning and thus accelerates developments."}'),
(52, 'notre.approche.cao.couvre.la.modélisation.paramétrique.des.composants.les.modélisations.surfacique.et.volumique.nos.offres.incluent.les.dessins.définition.fabrication.les.plans.densemble.les.schémas.électriques.et.dinstrumentation.les.tuyauteries.et....', '{"x":"Notre approche CAO couvre la mod\\u00e9lisation param\\u00e9trique des composants, les mod\\u00e9lisations surfacique et volumique. Nos offres incluent les dessins d\\u00e9finition \\/ fabrication, les plans d''ensemble, les sch\\u00e9mas \\u00e9lectriques et  d''instrumentation, les tuyauteries et les dessins tube de routage. Les pr\\u00e9traitements d\\u00e9di\\u00e9s sont \\u00e9galement propos\\u00e9s pour la plupart des logiciels commerciaux.","en":"Our CAD approach covers parametric component modeling, surface and volume modeling. Our offers include definition \\/ fabrication drawings, overall drawings, electrical schematics and instrumentation, pipework and tube routing drawings. Dedicated preprocessing is also available for most commercial software. "}'),
(53, 'calcul.scientifique', '{"x":"Calcul scientifique","en":"Dedicated scientific approach"}'),
(54, 'en.mécanique.et.structure.nos.équipes.maîtrisent.les.simulations.à.partir.de.logiciels.commerciaux.et.de.codes.open.source.en.statiquedynamique.linéaire.et.nonlinéaire.modale.et.vibratoire.fatigue.dynamique.rapide', '{"x":"En m\\u00e9canique et structure, nos \\u00e9quipes ma\\u00eetrisent les simulations \\u00e0 partir de logiciels commerciaux et de codes Open source en statique\\/dynamique, lin\\u00e9aire et nonlin\\u00e9aire, modale et vibratoire, fatigue, dynamique rapide..","en":"In mechanics and structure, our teams master the simulations from commercial software to open source codes in static \\/ dynamic, linear and nonlinear, modal and vibration, fatigue, fast dynamics."}'),
(55, 'dans.les.domaines.fluides.lensemble.des.caractéristiques.de.simulation.découlements.peut.être.conduit.turbulents.compressibles.incompressibles.isothermes.ou.anisothermes.réactifs.avec.réaction.chimique.etou.de.combustion.voire.découlements.diphasique...', '{"x":"Dans les domaines fluides, l\\u2019ensemble des caract\\u00e9ristiques de simulation d\\u2019\\u00e9coulements peut \\u00eatre conduit : turbulents compressibles \\/ incompressibles, isothermes ou anisothermes, r\\u00e9actifs avec r\\u00e9action chimique et\\/ou de combustion, voire d\\u2019\\u00e9coulements diphasiques.","en":"All fluid flow simulation can be carried out: compressible \\/ incompressible, isothermal or anisothermal turbulents, reactive with chemical reaction and \\/ or combustion, or even diphasic flows."}'),
(56, 'hpc.codes.dédiés', '{"x":"HPC & codes d\\u00e9di\\u00e9s","en":"HPC & dedicated mathematical software"}'),
(57, 'lexpertise.scientifique.de.nos.équipes.nous.permet.de.proposer.des.développements.de.codes.scientifiques.adaptés.à.la.demande.de.nos.clients', '{"x":"L\\u2019expertise scientifique de nos \\u00e9quipes nous permet de proposer des d\\u00e9veloppements de codes scientifiques adapt\\u00e9s \\u00e0 la demande de nos clients...","en":"The scientific expertise of our teams allows us to propose development of scientific codes adapted to the demand of our customers ... The advantage is for our partners to have a complete software integrating the exact needs without purchasing expensive licenses."}'),
(59, 'un.exemple.réduisez.votre.facture.annuelle.en.logiciel.cfd.par.16.comment.contactez.nous', '{"x":"Un exemple ? R\\u00e9duisez votre facture annuelle en logiciel CFD par 16*\\u2026 comment? Contactez-nous !","en":"An example? Reduced your annual CFD bill by 16 factor without altering quality is possible. Contact us!"}'),
(60, 'vous.voulez.réduire.vos.frais.de.calculs.scientifiques.notre.cloud.hpc.est.à.votre.service.à.prix.coutant', '{"x":"Vous voulez r\\u00e9duire vos frais de calculs scientifiques. Notre cloud HPC est \\u00e0 votre service \\u00e0 prix coutant*","en":"You want to reduce your scientific calculation costs. Our cloud HPC is at your service at attracting cost:  Development of your own soft integrating graphical interfaces, technical documents and management of licenses."}'),
(61, 'prestations.rédaction.des.codes.de.calculs.développement.dinterfaces.graphiques.rédaction.des.documents.techniques.gestion.des.licences', '{"x":"Prestations :\\u000bR\\u00e9daction des codes de calculs, d\\u00e9veloppement d\\u2019interfaces graphiques, r\\u00e9daction des documents, techniques, gestion des licences.","en":" "}'),
(62, 'outils.fortran.cc.delphi.mpi.opengl.net', '{"x":"Outils:\\u000bFortran, C\\/C++, Delphi, MPI, OpenGL, .NET,.","en":"Tools: Fortran, C \\/ C ++, Delphi, MPI, OpenGL, .NET,."}'),
(63, 'modélisation.avancée', '{"x":"Mod\\u00e9lisation avanc\\u00e9e","en":"Advanced Modeling"}'),
(64, 'nos.équipes.de.rd.travaillent.au.quotidien.avec.des.grands.nom.du.cac40.pour.les.aider.à.développer.des.nouveaux.modèles.encore.plus.précis.et.encore.plus.complets.les.approches.multi.physiques.sont.plus.particulièrement.visées.interaction.fluidestru...', '{"x":"Nos \\u00e9quipes de R&D travaillent au quotidien avec des grands nom du CAC40 pour les aider \\u00e0 d\\u00e9velopper des nouveaux mod\\u00e8les encore plus pr\\u00e9cis et encore plus complets, les approches multi-physiques sont plus particuli\\u00e8rement vis\\u00e9es: interaction fluide\\/structure, m\\u00e9canique du vol, \\u00e9coulement diphasiques\\u2026 autant de domaines pour lesquels les forts couplages rendent les mod\\u00e8les num\\u00e9riques d\\u00e9licats","en":"Our R & D teams work on a daily basis with major names in the CAC40 to helping them to develop comprehensive new models. Multi-physical approaches are more specifically targeted: fluid-structure interaction, flight mechanics, two-phase flow ... so many areas where strong coupling make numerical models tricky"}'),
(65, 'loptimation.et.la.précision.la.gestion.des.datas.ou.encore.le.développement.de.procédure.de.validation.automatique.est.au.cœur.de.nos.reflexions.nos.mathématiciens.sont.à.loeuvre', '{"x":"L\\u2019optimation et la pr\\u00e9cision, la gestion des datas ou encore le d\\u00e9veloppement de proc\\u00e9dure de validation automatique est au c\\u0153ur de nos reflexions.  Nos math\\u00e9maticiens sont \\u00e0 l\\u2019oeuvre!","en":"Optimization and accuracy, data management and the development of automatic validation procedures are at the heart of our reflections. Our mathematicians are at work!"}'),
(67, 'lexpertise.scientifique.de.nos.équipes.nous.permet.de.proposer.des.développements.de.codes.scientifiques.adaptés.à.la.demande.de.nos.clients.p.plavantage.est.pour.nos.partenaires.de.disposer.dun.logiciel.complet.intégrant.les.besoins.et.saffranchissa...', '{"x":"L\\u2019expertise scientifique de nos \\u00e9quipes nous permet de proposer des d\\u00e9veloppements de codes scientifiques adapt\\u00e9s \\u00e0 la demande de nos clients...<\\/p>\\n                    <p>L\\u2019avantage est pour nos partenaires de disposer d\\u2019un logiciel complet int\\u00e9grant les besoins et s\\u2019affranchissant d\\u2019achat de licences souvent co\\u00fbteuse.","en":"The scientific expertise of our teams allows us to propose development of scientific codes adapted to the demand of our customers ... The advantage is for our partners to have a complete software integrating the exact needs without purchasing expensive licenses."}'),
